column8:
「ロールセンターを最適化し、無敵のコーナリング性能を得る！」GT?Rをローダウンした際に起こるロールセンターの悪化。限られたスペースに４ＷＤユニットを収めるため、短く設計されたロアアームはダウン量に対して過度のアーム角に達し、不適切なジオメトリー変化を誘発します。 <br><br>「RCアダプター」は狂ったロールセンターを補正することでロール剛性を高め、効果的にロールを抑制します。また、アジャストプレートの脱着によって２種類の補正量が選択できるため、ダウン量に応じたセッティングも可能です。ジオメトリー補正されたフロントサスペンションは、国産スポーツの王者GT?Rの名に相応しいコーナリング性能を発揮します。<br><br>●保安基準適合品 ●補正量：20～25ｍｍ ●フロント専用 ●当製品を装着することによりトレッド幅が変化しますのでホイールオフセットにご注意下さい。 <br><br>対応車種：BCNR33 GT-R <br><br>　車検対応品<br><br>足回り/ロールセンターアダプター<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


