理想的なロールセンターが生みだすリニアな旋回性能と驚愕のトラクション性能 。長期に及ぶ開発テストの末、車高ダウンによって狂いが生じたロールセンターはロアアームのボールジョイントを最適なポジションに補正することで、車高ダウンの弊害であるコーナーリング時の「ロール量増加」を軽減することができます。 <br><br>純正ボールジョイントと交換するだけで、誰もがズバ抜けたコーナーリングスピードを体感でき、ドリフトではスーパートラクションの証である豪快なタイヤスモークを巻き上げるなど、最速を争うタイムアタックや極限のドリフトバトルでライバルを圧倒するポテンシャルを発揮。スポーツ走行の醍醐味を最大限に引き出す最強アイテムです。<br><br>●競技専用部品 ●リア専用 ●当製品を装着することによりトレッド幅が変化しますのでホイールオフセットにご注意下さい。 <br><br>対応車種：BNR34 ＧＴ－Ｒ <br><br>　競技専用品<br><br>足回り/ロールセンターアダプター<tr><td colspan="2">
