レースから培われた先進のテクノロジーを集結した高効率冷却装置「パワーラヂエター」　ノーマルに比べ増した水流量とアップした放熱量によって確実な冷却効果を実現します。コストパフォーマンスに優れたチューンド・ラヂエターです。 コア厚：32(一部車種を除く) <br><br>ノーマルラヂエターの場合、エンジンの高回転域を多様するシチュエーションではキャパシティが不足し、オーバーヒート状態に陥ります。さらに純正の水温計はドライバーに無用な心配をかけないよう甘い表示となっているのが一般的なため、このような状況でエンジンをベストコンディションに保つのはムリと言わざるを得ません。チューンドでは「酷」を強いているのと同じです。解決策は一つ、ラヂエターを高効率な物に交換することなのです。<br><br> <br><br>対応車種：JZA80 スープラ前期(93/5～96/5) A/T車用 (2JZ-GTE)　※純正：銅3層 <br><br>車検対応品<br><br>冷却系/ラジエーター<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


